      SELECT DISTINCT + - col1 + + + col1 + + - 75 + - 38 * - + col2 + - ( - + 86 ) + 53 + - ( + col2 ) * + - col2 * + - 17 AS col2 FROM tab2 (FORMAT parquet) AS cor0;
  - name: tab2

outputs:
  - name: q8600.out
    data: |
      -25616
      -54920
      -8055
